import React from "react"

class Users extends React.Component {
    users = [

    ]
    render() {
        if (this.users.length === 0) {
            return (
                <div className='user'>
                    <h3>No users</h3>
                </div>
            )
        }
        return (
            <div>
                {this.users.map((el) => (
                    <div className='user' key={el.id}>
                        <h3>{el.firstname} {el.surname}</h3>
                        <p>{el.bio}</p>
                    </div>
                ))}
            </div>
        )
    }
}

export default Users
